import React from 'react';
import { AuthField } from '../authorize/AutField';
import '../styles/profile.css';

class Profile extends React.Component {

    constructor(props) {
        super(props);
    }

	render() {
		return <section id="profileView" className="">
            <article className="profile-card">
                <section className="profile-type">
                    <div className="non-select login active">USER</div>
                </section>
                <section className="profile-info">
                    <AuthField name="login"/>
                    <AuthField name="email"/>
                    <AuthField name="phone"/>
                    <AuthField name="password"/>
                </section>
                <section className="profile-confirm">
                    <button id="profileConfirm" onClick={() => {
                        let userObj = {
                            login: document.getElementsByName("login")[0].innerText,
                            email: document.getElementsByName("email")[0].innerText,
                            phone: document.getElementsByName("phone")[0].innerText,
                            password: document.getElementsByName("password")[0].innerText
                        }
                        console.log(userObj);
                    }}>Save</button>
                </section>
            </article>
        </section>
	}
}
export default Profile;
